import React, { Component } from 'react'

export default class ListItem extends Component {
    render() {
        const listItems = []

        for(let i = 0; i < this.state.items.length; i++) {
          listItems.push(<ListItem item={this.state.items[i]} />)
        }

        return (

            <div>
                {listItems}
            </div>
        )
    }
}
